import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import ContainedButtons from "../ui/ContainedButttons";
import HomeIcon from "./HomeIcon";
import "../../../../index.css";
import Link from "@material-ui/core/Link";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: "#d2dae3",
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    fontFamily: "Lobster",
  },
}));

export default function GenNavBar(props) {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" style={{ backgroundColor: "#404040" }}>
        <Toolbar>
          <Typography
            variant="h6"
            className={classes.title}
            style={{ textAlign: "left" }}
            onClick={props.homeNav}
          >
            <Link href="/">My Portfolio</Link>
          </Typography>

          <HomeIcon></HomeIcon>

          <ContainedButtons
            signInNav={props.signInNav}
            signUpNav={props.signUpNav}
          ></ContainedButtons>
        </Toolbar>
      </AppBar>
    </div>
  );
}
